import React, { useState, useEffect } from 'react';
import Loading from './Loading';
import Legend from './Legend';
import Covidmap from './Covidmap';
import LoadCountriesTask from '../Tasks/LoadCountriesTask';

function Covid19(){
	const [ countries, setCountries ] = useState([ 1 ]);

	const loadData = () => {
		fetch(
			'https://cdn.glitch.com/748630ea-d707-440c-b84a-700982a6ab90%2Fhextest%20-%20Copy.json?v=1603727824740'
		)
			.then((response) => {
				return response.json();
			})
			.then((data) => {
				tempdata = data;
			})
			.then((setState) => setState);

		// const load = (setState) => {
		// 	setState;
		// };
	};
	// const loadCountriesTask = new LoadCountriesTask();
	// loadCountriesTask.load(
	// 	(countries) =>
	// 		setCountries(countries)
	// );

	useEffect(loadData);

	return (
		<div>
			<div>
				<Covidmap countries={countries} />

				<Legend />
			</div>
			{/* <div>{countries.length === 0 ? (<Loading />) : (<div><Covidmap countries={countries} /> <Legend /></div>)}</div > */}
		</div>
	);
}

export default Covid19;
